function obsoleteComponent(name,next_id,next_type_id){return['\n            {\n                "$id": {next_id},\n                "$type": "{next_type_id}|Game.Prefabs.ObsoleteIdentifiers, Game",\n                "name": "ObsoleteIdentifiers",\n                "active": true,\n                "m_PrefabIdentifiers": {\n                    "$id": {next_id2},\n                    "$type": "{next_type_id2}|Game.Prefabs.PrefabIdentifierInfo[], Game",\n                    "$rlength": 1,\n                    "$rcontent": [\n                        {\n                            "$id": {next_id3},\n                            "$type": "{next_type_id3}|Game.Prefabs.PrefabIdentifierInfo, Game",\n                            "m_Name": "{name}",\n                            "m_Type": "BrandPrefab"\n                        }\n                    ]\n                }\n            }'.replace("{name}",name).replace("{next_id}",next_id).replace("{next_type_id}",next_type_id).replace("{next_id2}",next_id+1).replace("{next_type_id2}",next_type_id+1).replace("{next_id3}",next_id+2).replace("{next_type_id3}",next_type_id+2),3,3]}